import React from 'react';

class Header extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className="sticky-top d-flex flex-column flex-sm-row ">
      <h1 className="logo col-sm-auto">Logo</h1>
      <div className="menu container container-fluid d-flex flex-column flex-sm-row">
        <a className="row m-2" href="./About">About</a>
        <a className="row m-2" href="./Stack">Stack</a>
        <a className="row m-2" href="./Projects">Works</a>
        <a className="row m-2" href="./Testimonials">Testimonials</a>
        <button type="button" className="btn border-primary col-sm-auto">Hire Me</button>
      </div>
    </div>
    );
  }
}

export { Header }
